import { Link } from 'react-router-dom';


function Navbar () {
    const logOut = async () => {
        await signOut(auth);
        navigate("/");
    }
    return (
        <>
            <div>
                <Link className="text-2xl active" to={"/"}>BearWear</Link>
                <div className="text-right">
                    <a>User</a>
                    <div>
                        <button onClick={logOut}>Log Out</button>
                    </div>
                </div>
            </div>
        </>

    );
};

export default Navbar;
